import "./HomeNavbar.css";
import Logo from "../../assets/icons/close.png";
import { NavLink } from "react-router-dom";
import Bemi from "../../assets/icons/bemi.png";
import MenuIcon from "../../assets/icons/menu.png";
import CloseIcon from "../../assets/icons/close.png";
import { useState } from "react";
const HomeNavbar = () => {
  const [navbar, showNavbar] = useState(false);

  const handleNavbar = () => {
    showNavbar(!navbar);
  };

  return (
    <nav className="navbar home">
      <div className="container">
        <div className="logo">
          <img src={Bemi} alt="Bemi editors" />
        </div>
        <div className={`middle-navigation ${navbar ? "active" : null}`}>
          <p><NavLink to="/" activeClassName="active" ></NavLink>Home</p>
          <p><NavLink to="/academic-subjects" activeClassName="active" ></NavLink>Academic subjects</p>
          <p><NavLink to="/academic-blogs" activeClassName="active" ></NavLink>Assignment blog</p>
          <p><NavLink to="/contact-us" activeClassName="active" ></NavLink>Contact us</p>
          <p><NavLink to="login" activeClassName="active" ></NavLink>Login</p>
        </div>
        <div className="social-media">
          <p>
            {" "}
            <i className="fa-brands fa-square-twitter"></i>
          </p>
          <p>
            <i className="fa-brands fa-square-instagram"></i>
          </p>
          <p>
            <i className="fa-brands fa-square-facebook"></i>
          </p>
        </div>
        {navbar ? (
          <div className="menu-icon" onClick={handleNavbar}>
            <img src={CloseIcon} alt="" />
          </div>
        ) : (
          <div className="menu-icon" onClick={handleNavbar}>
            <img src={MenuIcon} alt="" />
          </div>
        )}
      </div>
    </nav>
  );
};

export default HomeNavbar;
